render(){
    return(
        <div class="container">
        <br/>
        <br/>
        <div class="row">
            <div class="col s12">
              <div class="card #ff6e40 deep-orange accent-2">
                <div class="card-content white-text">
                  <span class="card-title">Academics</span>
                  <p>Ban 8 AM classes.</p>
                </div>
                <div class="card-action">
                    <a class="modal-trigger white-text" href="#modal1">Read More...</a>
                    
                </div>
              </div>
            </div>
            </div>
            </div>
    )
}
}
export default Home;
